import './styles/App.scss';
// import styles

// Adding components
import Player from './components/Player'
import Song from './components/Song'

function App() {
  return (
    <div className="App">
      <h1>Chill Vibes Music</h1>
      <Song/>
      <Player/>
    </div>
  );
}

export default App;
